import axios from "axios";
import { API_URL } from ".";

export const getCities = async () => {
  return axios
    .get(`${API_URL}/cities`)
    .then(({ data }) => {
      return data;
    })
    .catch((err) => console.log(err));
};

export const getOneCity = async (citiId) => {
  return axios
    .get(`${API_URL}/cities/${citiId}`)
    .then(({ data }) => {
      return data;
    })
    .catch((err) => console.log(err));
};

export const saveHistory = async (params) => {
  return axios
    .post(`${API_URL}/historic`,params)
    .then(( data ) => {
      const save = false
      if (data.status==201){
        console.log("que pasa")
        save = true
      }
      return save;
    })
    .catch((err) => {
      return false;
    });
};
